import React, { useState } from 'react';
import './DynaButton.css';

function DynaButton({children, isGoogle, ...otherProps}) {

    return(
        <button 
            className={`${isGoogle ? 'dyna-btn-google' : 'dyn-button'}`}
            {...otherProps}
        >
            {children}
            {console.log(children)}
        </button>
    );
};

export default DynaButton;
